import React, { useEffect, useState } from "react";
import axios from "axios";
import API_URL from "../config";

const SismosTable = () => {
    const [sismos, setSismos] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        // Agrega console.log para depurar
        console.log("Intentando obtener datos de:", API_URL);
        
        setLoading(true);
        axios.get(API_URL)
            .then(response => {
                console.log("Datos recibidos:", response.data);
                setSismos(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error("Error al obtener sismos:", error);
                setError(`Error: ${error.message}`);
                setLoading(false);
            });
    }, []);

    if (loading) return <div>Cargando datos de sismos...</div>;
    if (error) return <div className="error">{error}</div>;
    if (sismos.length === 0) return <div>No hay registros de sismos para mostrar.</div>;

    return (
        <div>
            <h2>Lista de Sismos</h2>
            <p>Total de registros: {sismos.length}</p>
            <table className="sismos-table">
                <thead>
                    <tr>
                        <th>Fecha</th>
                        <th>Hora</th>
                        <th>Magnitud</th>
                        <th>Latitud</th>
                        <th>Longitud</th>
                        <th>Profundidad</th>
                        <th>Ubicaci√≥n</th>
                    </tr>
                </thead>
                <tbody>
                    {sismos.map((sismo, index) => (
                        <tr key={index}>
                            <td>{sismo.fecha}</td>
                            <td>{sismo.hora}</td>
                            <td>{sismo.magnitud || "No calculable"}</td>
                            <td>{sismo.latitud}</td>
                            <td>{sismo.longitud}</td>
                            <td>{sismo.profundidad} km</td>
                            <td>{sismo.referenciaLocalizacion}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default SismosTable;
